INSERT INTO `serie` (`id`, `title`, `premiere`, `genre`, `descri`, `picture`) VALUES
(1, 'Riverdale', '2017-01-26', 'Crime', 'A pequena e tranquila cidade de Riverdale fica de cabeça para baixo quando é atingida pela misteriosa morte de Jason Blossom, um garoto popular do ensino médio e membro da família mais poderosa da cidade. Archie Andrews, Betty Cooper, Veronica Lodge, Jughead Jones, Cheryl Blossom,Kevin Keller, Josie Mccoy e seus amigos exploram os problemas da vida cotidiana na pequena cidade, enquanto investigam o caso de Jason Blossom. Mas, para resolver este mistério, o grupo de amigos deve descobrir os segredos que estão enterrados profundamente na superfície da cidade, pois Riverdale pode não ser tão inocente como parece.', );
INSERT INTO `serie` (`id`, `title`, `premiere`, `genre`, `descri`, `picture`) VALUES
(3, 'How to Get Away with Murder', '2014-09-25', 'Drama ', 'Michaela, Wes, Laurel e Patrick são ambiciosos calouros de Direito da prestigiada academia East Coast Law School, onde apenas os melhores alunos podem participar de casos reais. Eles competem entre si para conseguir a atenção da carismática e sedutora Professora Annalise DeWitt (Viola Davis), na aula de Direito Criminal 1, também conhecida como \"Como Se Livrar de Um Assassinato\".', );
INSERT INTO `serie` (`id`, `title`, `premiere`, `genre`, `descri`, `picture`) VALUES
(4, 'Friends', '1994-09-24', 'Comédia', 'Seis jovens são unidos por laços familiares, românticos e, principalmente, de amizade, enquanto tentam vingar em Nova York. Rachel é a garota mimada que deixa o noivo no altar para viver com a amiga dos tempos de escola Monica, sistemática e apaixonada pela culinária.', );
INSERT INTO `serie` (`id`, `title`, `premiere`, `genre`, `descri`, `picture`) VALUES
(5, 'Doctor Who', '2005-03-26', 'Ficção Científica', 'Um excêntrico extraterrestre viaja pelo tempo e espaço para resolver problemas e lutar contra injustiças. Sua antiga e não muito confiável nave espacial se assemelha a uma cabine telefônica, mas ela é muito mais do que parece ser.', );
INSERT INTO `serie` (`id`, `title`, `premiere`, `genre`, `descri`, `picture`) VALUES
